app.controller("help",["$scope","$http",function(e,i){$("#help_nav").accordion({collapsible:!0,active:!1,header:"h3",heightStyle:"content"}),$("#help_search").autocomplete({source:function(e,i){$.ajax({url:APP_URL+"/ajax_help_search",type:"GET",dataType:"json",data:{term:e.term},success:function(e){i(e),$(this).removeClass("ui-autocomplete-loading")}})},search:function(){$(this).addClass("loading")},open:function(){$(this).removeClass("loading")}}).autocomplete("instance")._renderItem=function(e,i){return 0!=i.id?($("#help_search").removeClass("ui-autocomplete-loading"),$("<li>").append("<a href='"+APP_URL+"/help/article/"+i.id+"/"+i.question+"' class='article-link article-link-panel link-reset'><div class='hover-item__content'><div class='col-middle-alt article-link-left'><i class='icon icon-light-gray icon-size-2 article-link-icon icon-description'></i></div><div class='col-middle-alt article-link-right'>"+i.value+"</div></div></a>").appendTo(e)):($("#help_search").removeClass("ui-autocomplete-loading"),$("<li style='pointer-events: none;'>").append("<span class='article-link article-link-panel link-reset'><div class='hover-item__content'><div class='col-middle-alt article-link-left'><i class='icon icon-light-gray icon-size-2 article-link-icon icon-description'></i></div><div class='col-middle-alt article-link-right'>"+i.value+"</div></div></span>").appendTo(e))}}]);
